import React from 'react';
import { Link } from 'react-router-dom';
import styles2 from './../styles/styles_sub.module.css'; // Updated for CSS Modules

function Sos() {
  return (
    <div className={styles2.section}>
      {/* Page Head */}
      <meta charSet="UTF-8" name="viewport" content="width=device-width, initial-scale=1.0" />
      <title>sOS</title>

      {/* Page Content */}
      <div className={styles2.overlay} id="overlay"></div>

      {/* Header */}
      <header id={styles2.header}>
        <Link to="/">
          <button id={styles2.gsBtn}>GS</button>
        </Link>
      </header>

      {/* Main */}
      <main className={styles2.main}>
        <div className={styles2.container}>
          {/* Top Grid */}
          <div className={styles2.grid1}>
            {/* Section | Title */}
            <section className={styles2.title}>
              <h1>sOS</h1>
            </section>
            {/* Section | Brief */}
            <section className={styles2.brief} id="brief">
              <h3>
                Description: 
                <p>(Date of origin: 12/2024)</p>
              </h3>
              WIP, see link below <br />
              <a href="https://github.com/Shadowpatriot9/sOS">Link</a>
            </section>
          </div>
        </div>
      </main>

      {/* Footer */}
      <footer className={styles2.footer}>
        <div className={styles2.graphic}>
          <p>© 2024 Grayden Scovil</p>
        </div>
        <div className={styles2.loveNote}>
          <p>Made with ♥</p>
        </div>
      </footer>
    </div>
  );
}

export default Sos;
